How many times have we said this ourselves or heard someone say this? And when we don‚Äôt see the results we were expecting we get frustrated, give up or resort to drastic, unsustainable methods. It's important to not set yourself up for failure before you even begin by setting realistic goals!
.
In my experience, people often aren‚Äôt aware of the effort or time it takes to change their body composition. Setting realistic weight loss goals and losing weight in a safe and effective manner will help you maintain your weight loss in the long term. There is no quick fix if you want long term results. 
